import React, { Component } from 'react';
import styles from './work.module.scss';
import { Link } from 'react-router-dom';





export default ({ dataSource }) => {
    return <div className={styles.worklist}>
        <ul>
            {
                dataSource && dataSource.map(item =>
                    <li>
                        <Link to="/resume">
                            <div className={styles.cover}>
                                <img src={item.cover} />
                            </div>
                            <div className={styles.workbrief}>
                                <h2>{item.title}</h2>
                                <p>{item.brief}</p>
                                <div className={styles.tag}>
                                    {item.tag && item.tags.map((item,index) => <span key={item,index}>{item}</span>)}
                                </div>
                            </div>
                        </Link >
                    </li>
                )
            }
        </ul>
    </div>
}


class WorkLists extends Component {
    render(){
        return <div className={styles.worklist}>
        <ul>
            {
                dataSource && dataSource.map(item =>
                    <li>
                        <Link to="/resume">
                            <div className={styles.cover}>
                                <img src={item.cover} />
                            </div>
                            <div className={styles.workbrief}>
                                <h2>{item.title}</h2>
                                <p>{item.brief}</p>
                                <div className={styles.tag}>
                                    {item.tag && item.tags.map((item,index) => <span key={item,index}>{item}</span>)}
                                </div>
                            </div>
                        </Link >
                    </li>
                )
            }
        </ul>
    </div>
    }
}

